INSERT INTO `tl_content` VALUES ( 7, 1, 'tl_article', 96, 1505323100, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:24:"Samlernen Finally Online";}', '<p class="p1">About 2 years ago I launched my first website for my English teaching business in Hannover. I used WordPress and a Template, I wasnt a real web designer (yet), I just had an interest for coding and computer science. After a long journey, SamLernen now has its new website. It isnt complete, there are still hundreds of ideas that I want to implement into the site, and I will when I find the time.</p>\n<p class="p2">[nbsp]</p>\n<p class="p1">It has the two things I desperately needed for my clients, a timetable and a log in systems where clients could upload files and save their data.</p>\n<p class="p2">[nbsp]</p>\n<p class="p1">Welcome to the new site! Many new changes will follow</p>', '1', 0xb2b3ae9e94a111e7adfad578d8d19268, '', '', 'a:3:{i:0;s:3:"100";i:1;s:3:"100";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', '' );
