INSERT INTO `tl_content` VALUES ( 50, 10, 'tl_article', 384, 1502439024, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:0:"";}', '<p>The Bitcoin Cash (BCH) blockchain is moving along processing blocks and is currently thriving as a network. So far theres been 408 blocks found on the BCH chain, and the currency has been trading heavily on exchanges. At the moment, bitcoin cash is trading at $300 per BCH and has the fourth largest cryptocurrency market cap. There are a lot of exchanges and cryptocurrency wallet providers that have decided to support the BCH network so far. Moreover, other types of operations like the marketplace Purse has also[nbsp]<a href="https://blog.purse.io/announcement-update-bitcoin-cash/" target="_blank" rel="noopener">announced</a>[nbsp]BCH distribution for customer funds held on the platform.</p>\n<p>Its been a crazy ten days for bitcoin enthusiasts as the network had its first high profile hard fork that split the network into two. During the first week, the Bitcoin Cash blockchain has pushed forward, and the currencys market is thriving. Now two cryptocurrency payment processors, the Living Room of Satoshi, and Rocketr have announced supporting BCH on their platforms.</p>', '1', 0x24e1e54c7d9311e7b1baec9b4278947f, '', '', 'a:3:{i:0;s:3:"100";i:1;s:3:"100";i:2;s:3:"box";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', '' );
