INSERT INTO `tl_content` VALUES ( 217, 64, 'tl_article', 640, 1505235484, 'text', 'a:2:{s:4:"unit";s:2:"h3";s:5:"value";s:43:"What will Facebook look like in the future?";}', '<p>If the current trend of[nbsp]<em>digitalization</em>[nbsp]continues, how will Facebook change? As the company conintue to be profitable, it will continue to develop itself. It will continue to develop new ways for the service to be exiting, it will add more things that humans enjoy like Virtual Reality (they already have plans for it), more integration with our devices and it will continue to use the huge amounts of data we give them.[nbsp]</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, 'bwa-GtWp4h4', NULL, 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', '' );
