INSERT INTO `tl_content` VALUES ( 236, 68, 'tl_article', 128, 1505236997, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:23:"The expansion of Amazon";}', '<p>Amazon, a word which once made people think of the rain forest in Brazil is now a household name and it is growing. Amazon started as a simple book[nbsp]<span style="text-decoration: underline;">retailer,</span>[nbsp]which then branched out into selling other items, soon it had become a huge[nbsp]<span style="text-decoration: underline;">competitor</span>[nbsp]to Ebay and now usually outsells them. Amazon has launched itself in 16 countries worldwide and sells more and more every year. How is it so successful? Many describe the business model of Amazon as one which "is designed to strangle and kill off local business", they do this by offering lower prices and fairly low delivery times. How do they do this?[nbsp]<span style="text-decoration: underline;">Offshore tax evasion</span>[nbsp]and highly organised mass production style distribution centres. Workers in these centers often complain of low[nbsp]<span style="text-decoration: underline;">wages,</span>[nbsp]limited toilet breaks and harsh working conditions. Amazon has recently began to expand its[nbsp]<span style="text-decoration: underline;">presence</span>[nbsp]and many post offices and university campuses now have Amazon delivery stations</p>', '', NULL, '', '', '', '', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '0', 0, '', 10, '', '', '', '', '' );
