INSERT INTO `tl_content` VALUES ( 260, 7, 'tl_article', 556, 1505328567, 'text', 'a:2:{s:4:"unit";s:2:"h1";s:5:"value";s:10:"Hi I\'m Sam";}', '<p class="p1">Nice to see that somebody is reading about me! Im a man from England who loves to work and travel. I work as a freelance web developer and online English teacher. My hobbies are travelling, languages and meeting different people. I like to be different and dont really care what other people think about me. Im currently living in the south of Spain. Sometimes I sleep on mountains next to castles, sometimes in abandoned villas and sometimes in cosy AirBNBs. I also spent 3 weeks in a stunningly beautiful hippy village smoking weed and taking LSD. I live the nomad life and hate to be normal, boring or politically correct. The world needs to change, and we should be able to say what we believe. I channel my inspiration from all my travels and crazy activities into giving fun and exciting English lessons.</p>', '', 0xf5a6132093c711e796b9018ec739c73b, '', '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:0:"";}', 'a:5:{s:6:"bottom";s:0:"";s:4:"left";s:0:"";s:5:"right";s:0:"";s:3:"top";s:0:"";s:4:"unit";s:0:"";}', '', '', '', 'right', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:8:"col-md-6";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', NULL, 0, 0, '', 0, '', 10, '', '', '', '', '' );
