INSERT INTO `tl_dlh_googlemaps_elements` VALUES ( 4, 1, 96, 1505246287, 'Marker Valencia', 'MARKER', '', 'es', '39.473520, -0.376276', 'SIMPLE', 'INFO', NULL, '1', NULL, NULL, 'a:3:{i:0;s:2:"16";i:1;s:2:"16";i:2;s:2:"px";}', 'a:3:{i:0;s:1:"0";i:1;s:1:"0";i:2;s:2:"px";}', '', NULL, 'a:3:{i:0;s:2:"32";i:1;s:2:"32";i:2;s:2:"px";}', '000000', '100', '1', '', '100', '1000', '', 1, '', '', '', '<p>After having a lot of fun exploring Barcelona, I decided it was time to leave after a week. I made a really great friend in the hostel I stayed at. He was a programmer and digital nomad like myself. He was sad to see me go. I took the train to Valencia and stayed in an AirBnB with two fun guys from Chile. One had the same music taste as me and we had a chilled out rap party on his roof[nbsp]</p>', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:2:"px";}', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:2:"px";}', '', '', '', NULL, '', '1', '0', '1', '0', '1' );
