INSERT INTO `tl_search` VALUES ( 7, 63, 1505380494, 'Is Macron the next Trump?', 'http://samlernen.de/index.php/63.html', 'Is Macron the next Trump? I am my Facebook and it is me The power of Facebook.... Sometimes we just need to stop and ask ourselves, how did Facebook get so far? Before 2005 even, many people did not know about Facebook, yet alone have it. Now within the youngest generation. It seems like everybody has a Facebook and the trend of social media is not dying out. More and people are signing up with other social networks like Twitter, Instagram, Steam, Playstation Network and Xing. -Do you have a Facebook account? What do you use it for? -How often do you use your Facebook account? As a teenager, I grew up at a time when Facebook was becoming popular. The generation before me did not use Facebook and people only really began to use it around the ages of 14 to 15. Nowadays it seems children as young as 7 - 8 have Facebook. The amount of children with mobile phones is always increasing and with it the amount of Facebook Mobile users. What will Facebook look like in the future? If the current trend of digitalization continues, how will Facebook change? As the company conintue to be profitable, it will continue to develop itself. It will continue to develop new ways for the service to be exiting, it will add more things that humans enjoy like Virtual Reality (they already have plans for it), more integration with our devices and it will continue to use the huge amounts of data we give them. What about the data? This is the most important part. The data that Facebook collects about you, the data many people simply chose to forget about. Depending on the user and how much much they use Facebook, it knows where you are in the world, it knows who your friends are, it knows your opinions about things and it knows what you say to your friends. Conversations and voice calls are recorded, images processed and facially recognised, social patterns analysed; all this by a computer running complex algorithms. Are you worried about what Facebook can do with all your personal information? Do you think the government has access to your information through Facebook? How do you feel about computers analysing your personal information to give you suitable adverts?[ Leave a comment Contao Demo,', '15.12', 'e6b206dc98b6b903f341c128c43bc3ca', '', 0x30, 'en' );
